import React from 'react';

function Header() {
  return (
    <>
      <section>
        <img
          src="https://notaboutthemiles.com/wp-content/uploads/2017/11/Grand-Canal-in-Venice.jpg"
          alt="Header Image"
          style={{ opacity: 0.9 }}
        />
      </section>
    </>
  );
}

export default Header;
